import React from "react";
import Navbar from "./Navbar"; // Import the Navbar component

const App = () => {
  return (
    <div>
      <Navbar />
      <div className="section-buttons">
        <button className="button-link">For Doctors</button>
        <button className="button-link">For Clinics and DSO</button>
        <button className="button-link">For Laboratories</button>
      </div>
      {/* Add more content or sections here */}
    </div>
  );
};

export default App;
